import React, { Fragment, useEffect } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getCurrentOwnerVehicle } from '../../../actions/Sub-Admin/OwnerProfile';
import Spinner from '../layout/spinner';
import { Link } from 'react-router-dom';
import ProfileTop from './ProfileTop';
import CurrentOwnerVehicleItem from './CurrentOwnerVehicleItem';
import VehicleItem from '../Vehicle/VehicleItem';

const CurrentOwnerVehicle = ({
  getCurrentOwnerVehicle,
  profile: { profiles, loading },
  auth,
  match
}) => {
  useEffect(() => {
    getCurrentOwnerVehicle(profile.id);
  }, [getCurrentOwnerVehicle, profile.id]);

  return (
    <Fragment>
      {loading ? (
        Spinner
      ) : (
        <Fragment>
          <h1 className='large text-primary'> Registerd Vehicle At SAWARI</h1>
          <div className='profiles'>
            {profiles.length > 0 ? (
              profiles.map(profile => (
                <VehicleItem key={profile._id} profile={profile} />
              ))
            ) : (
              <h4> {Spinner} </h4>
            )}
          </div>
        </Fragment>
      )}
    </Fragment>
  );
};
CurrentOwnerVehicle.propTypes = {
  getCurrentOwnerVehicle: PropTypes.func.isRequired,
  profile: PropTypes.object.isRequired,
  auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  profile: state.profile,
  auth: state.auth
});

export default connect(mapStateToProps, { getCurrentOwnerVehicle })(
  CurrentOwnerVehicle
);
